import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Offcanvas from 'react-bootstrap/Offcanvas';
import 'bootstrap/dist/css/bootstrap.min.css';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import './Navbarmenu.css'
import { signout } from "../../service/ApiService";
import { Component } from 'react';

export class Navbarmenu extends Component {

  static propTypes = {
    auth: PropTypes.object.isRequired,
    logout: PropTypes.func.isRequired
  }


render () {

  const { isAuthenticated, user } = this.props.auth;
  const authLinks = (
    <ul className="navbar-nav mr-auto mt-2 mt-lg-0">
      <li className="nav-item">
        <button onClick={this.props.logout} className="nav-link btn btn-info btn-sm text-light">로그아웃</button>
      </li>
    </ul>
  );
  const guestLinks = (
                      <ul className="navbar-nav mr-auto mt-2 mt-lg-0">
                          <li className="nav-item">
                              <Nav.Link to="/register" className="nav-link">회원가입</Nav.Link>
                          </li>
                          <li className="nav-item">
                              <Nav.Link to="/login" className="nav-link">로그인</Nav.Link>
                          </li>
                         </ul>                        
  );


  return (
    <>
      {['md'].map((expand) => (
        <Navbar key={expand} bg="light" expand={expand} className="mb-3">
          <Container fluid>
            <Navbar.Brand id="title" href="/"><i class="fa-solid fa-seedling" />Greener</Navbar.Brand>
            <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
            <Navbar.Offcanvas
              id={`offcanvasNavbar-expand-${expand}`}
              aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
              placement="end"
            >
              <Offcanvas.Header closeButton>
                <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}>
                <i class="fa-solid fa-seedling" />Greener
                </Offcanvas.Title>
              </Offcanvas.Header>
              <Offcanvas.Body>
                <Nav className="justify-content-end flex-grow-1 pe-3">
                  <Nav.Link href="#action1">식물추천</Nav.Link>
                  <Nav.Link href="#">식물호텔</Nav.Link>
                  <NavDropdown
                    title="커뮤니티"
                    id={`offcanvasNavbarDropdown-expand-${expand}`}
                  >
                    <NavDropdown.Item href="#action3">식물마켓</NavDropdown.Item>
                    <NavDropdown.Item href="#action4">소통마당</NavDropdown.Item>
                  </NavDropdown>

                  <NavDropdown
                    title="마이페이지"
                    id={`offcanvasNavbarDropdown-expand-${expand}`}
                  >
                    <NavDropdown.Item href="#action3">회원정보 조회</NavDropdown.Item>
                    <NavDropdown.Item href="#action4">1:1 문의</NavDropdown.Item>
                    <NavDropdown.Item href="#action4">내 식물</NavDropdown.Item>
                  </NavDropdown>
                  <Nav.Link href="#">공지사항</Nav.Link>
                  <Nav.Link href="#">FAQ</Nav.Link><br/>
                  {/* <Button onClick={signout}>로그아웃</Button>
                  <Nav.Link id="loginbtn" href="/login">로그인</Nav.Link> */}
                  {isAuthenticated ? authLinks : guestLinks}
                </Nav>
              </Offcanvas.Body>
            </Navbar.Offcanvas>            
          </Container>
        </Navbar>
      ))}
    </>
  );
}
}

const mapStateToProps = state => ({
  auth: state.auth
});

export default connect(mapStateToProps, { signout })(Navbarmenu);
